using System.IO;
using NUnit.Framework;
using Moq;
using Duftfinder.Web.Helpers;


namespace Tests.Duftfinder.Web.Helpers
{
    [TestFixture]
    public class ConversionHelperTest
    {
        private ConversionHelper _conversionHelper;

        private const string Base64PictureString = "";
    
        [SetUp]
        public void SetUp()
        {
            _conversionHelper = new ConversionHelper();
        }

        [TearDown]
        public virtual void TearDown()
        {

        }

        [Test]
        public void GenerateBase64StringForPicture_GivenPicture_ShouldGenerateBase64String()
        {
            // Arrange
            string fileName = "testimage.jpg";
            // Get the executing directory of the tests 
            string dir = TestContext.CurrentContext.TestDirectory;
            // Infer the project directory from there...2 levels up.
            dir = Directory.GetParent(dir).Parent?.FullName;
            string filePath = $"{dir}\\TestData\\{fileName}";

            Stream stream = new FileStream(filePath, FileMode.Open);
            MockPostedFileBase uploadFile = new MockPostedFileBase(stream, "", fileName);

            // Act
            string result = _conversionHelper.ResizeAndGenerateBase64StringForPicture(uploadFile);

            // Assert
            Assert.AreEqual(Base64PictureString, result);
        }

    }


}

